import { jsPDF } from 'jspdf';
import { Form } from '@unform/web';

export default function NewCertificate() {

  function gerarCertificado() {
    const image = new Image();
    image.src = "data:image/jpeg;base64,";
    const nomeAluno = 'Hugo Hoch';
    const certificado = new jsPDF({
      orientation: 'landscape',
      unit: 'cm',
      format: 'a4'
    });
    

    certificado.addImage(image, 'JPEG', 0, 0, 29.7, 21);
    
    certificado.setFontSize(40);
    certificado.text(10, 4, 'CERTIFICADO');
    certificado.setFontSize(20);
    certificado.text(5, 8, 'Certificamos que o aluno ' + nomeAluno +
      '\nparticipou do evento {evento}\n' +
      'perfazendo a carga horária de {cargaHoraria} horas.');

    certificado.save("Certificado.pdf");

  }
  return (
    <>
      <div className="menu-temp">
        <a href="http://localhost:3000/participant">Voltar</a>
        <a href="http://localhost:3000/new-participant">Participante</a>
        <a href="http://localhost:3000/new-manager">Organizador</a>
        <a href="http://localhost:3000/new-event">Evento</a>
        <a href="http://localhost:3000/">Login</a>
        <a href="http://localhost:3000/new-certificate">Gerar Certificado</a>
        <a href="http://localhost:3000/manager">Dash Organizador</a>
      </div>

      <div className="container">
        <Form onSubmit={gerarCertificado}>
          <h1>Clique para gerar o certificado</h1>
          <button className="btn" type="submit">Gerar</button>
        </Form>
      </div>


    </>
  );
};

